    void set_sdl_icon(SDL_Window* window)
    {
        // https://blog.gibson.sh/2015/04/13/how-to-integrate-your-sdl2-window-icon-or-any-image-into-your-executable/
        // these masks are needed to tell SDL_CreateRGBSurface(From)
        // to assume the data it gets is byte-wise RGB(A) data
        Uint32 rmask, gmask, bmask, amask;
#if SDL_BYTEORDER == SDL_BIG_ENDIAN
        const int shift = (img_logo.bytes_per_pixel == 3) ? 8 : 0;
        rmask           = 0xff000000 >> shift;
        gmask           = 0x00ff0000 >> shift;
        bmask           = 0x0000ff00 >> shift;
        amask           = 0x000000ff >> shift;
#else // little endian, like x86
        rmask = 0x000000ff;
        gmask = 0x0000ff00;
        bmask = 0x00ff0000;
        amask = (img_logo.bytes_per_pixel == 3) ? 0 : 0xff000000;
#endif

        SDL_Surface* icon = SDL_CreateRGBSurfaceFrom(static_cast<void*>(const_cast<unsigned char*>(img_logo.pixel_data)), img_logo.width, img_logo.height, img_logo.bytes_per_pixel * 8, img_logo.bytes_per_pixel * img_logo.width, rmask, gmask, bmask, amask);
        SDL_SetWindowIcon(window, icon);
        SDL_FreeSurface(icon);
    }

